ppear again when he returns back to the project. For example, I’ve uploaded files for one of the project and when I returned back to it, I found that none of the files are there. This is a fatal error!, no one will trust our system if it deletes its information. Very important: All titles, labels, lists, boxes, buttons','I went through the system very quickly and below are my comments.  Very important: Anything that the researcher has already filled-up should be stored in the database and have to appear again when he returns back to the project. For example, I’ve uploaded files for one of the project and when I returned back to it, I found that none of the files are there. This is a fatal error!, no one will trust our system if it deletes its information. Very important: All titles, labels, lists, boxes, buttons',12,'15','31','','0','0000-00-00','','uploads/abstracts_ar/12_1205.1648.pdf','uploads/abstracts_en/12_1205.1648.pdf','uploads/introductions/12_JIH-MSP-2011-04-008.pdf','uploads/literature_reviews/12_1205.1648.pdf',1,'2015-02-22',4,1435,0,'0000-00-00 00:00:00',0.00,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,'0000-00-00','2',0,'uploads/research_method/12_0912f50cb27c27d5bc000000.pdf','','uploads/objective_approach/12_1205.1648.pdf','','','','','','','','0','','',0,'',1,0),(13,'الحاسب العملاق','High Performance Computing',18,'23','78','','0','0000-00-00','','uploads/abstracts_ar/13_SOLStatement_Nov_2014.pdf','uploads/abstracts_en/13_ArabicCv.pdf','uploads/introductions/13_ArabicCv.pdf','uploads/literature_reviews/13_ArabicCv.pdf',1,'2015-02-22',6,1435,0,'0000-00-00 00:00:00',0.00,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,'2015-03-02','1',0,'uploads/research_method/13_ArabicCv.pdf','uploads/objective_tasks/13_ArabicCv.pdf','uploads/objective_approach/13_ArabicCv.pdf','uploads/working_plan/13_ArabicCv.pdf','uploads/value_to_kingdom/13_ArabicCv.pdf','uploads/budget/13_ArabicCv.pdf','uploads/outcome_objectives/13_ArabicCv.pdf','','','','0','','',0,'',1,0),(14,'الكمبيوتر العملاق','Supercomputer',18,'24','84','','0','0000-00-00','','uploads/abstracts_ar/14_ArabicCv.pdf','uploads/abstracts_en/14_ArabicCv.pdf','uploads/introductions/14_ArabicCv.pdf','uploads/literature_reviews/14_ArabicCv.pdf',1,'2015-02-22',6,1435,0,'0000-00-00 00:00:00',0.00,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,'0000-00-00','2',0,'','','','','','','','','<p>&nbsp;45tqew4twet</p>','<p>&nbsp; 45tqew4twet</p>','<p>45tqew4twet</p>','<p>&nbsp; 45tqew4twet</p><p>&nbsp;</p>','<p>&nbsp; 45tqew4twet</p>',0,'',1,0),(15,'dddddddddddddddddddddddddddddd','ddddddddddddddddddddddddddddddddddddddddd',12,'14','23','','0','0000-00-00','','','','','',1,'2015-02-26',3,2015,0,'0000-00-00 00:00:00',0.00,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,'2015-04-04','2',3,'','','','','','','','','<p>&nbsp;sssssssssssssssssssss</p>','<p>&nbsp;sssssssssssssss</p>','<p>&nbsp;<g class=\"gr_ gr_3 gr-alert gr_spell ContextualSpelling\" id=\"3\" data-gr-id=\"3\">ssssssssssssss</g></p>','<p>&nbsp;ssssssssssssssssss</p>','<p>&nbsp;sssssssssssssssssss</p>',0,'',1,0),(16,'تطوير لغة برمجية باللغة العربية','Development of an Arabic programming language',12,'5','18','','0','0000-00-00','','','','','',1,'2015-02-26',2,2015,0,'0000-00-00 00:00:00',0.00,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,'2015-04-04','1',3,'','','','','','','','','<p style=\"text-align: left;\">A programming language is a formal constructed language designed to communicate instructions to a machine, particularly a computer. Programming languages can be used to create programs to control the behavior of a machine or to express algorithms.</p><p style=\"text-align: left;\">The earliest programming languages preceded the invention of the digital computer and were used to direct the behavior of machines such as Jacquard looms and player pianos.[1] Thousands of different programming languages have been created, mainly in the computer field, and many more still are being created every year. Many programming languages require computation to be specified in an imperative form (i.e., as a sequence of operations to perform), while other languages utilize other forms of program specification such as the declarative form (i.e. the desired result is specified, not how to achieve it).</p><p style=\"text-align: left;\">The description of a programming language is usually split into the two components of syntax (form) and semantics (meaning). Some languages are defined by a specification document (for example, the C programming language is specified by an ISO Standard), while other languages (such as Perl) have a dominant implementation that is treated as a reference.</p>','<p style=\"text-align: right;\">السعودية ورسمياً المملكة العربية السعودية هي دولة تقع في جنوب غرب آسيا وتشكل الجزء الأكبر من شبه الجزيرة العربية إذ تبلغ مساحتها حوالي مليوني كيلومتر مربع. يحدها من الشمال العراق والأردن وتحدها الكويت من الشمال الشرقي، ومن الشرق تحدها كل من قطر والإمارات العربية المتحدة بالإضافة إلى البحرين التي ترتبط بالسعودية من خلال جسر الملك فهد الواقع على الخليج العربي، ومن الجنوب تحدها اليمن، وسلطنة عمان من الجنوب الشرقي، كما يحدها البحر الأحمر من جهة الغرب.[11]</p><p style=\"text-align: right;\">كانت بداية السعودية بتأسيس الدولة السعودية الأولى (إمارة الدرعية) على يد محمد بن سعود سنة 1157 هـ / 1744 والتي انتهت سنة 1235 هـ / 1820،[12] ثم تبعتها الدولة السعودية الثانية (إمارة نجد) وكانت قد بدأت بعد سقوط الدولة الأولى إلى أن انتهت سنة 1308 هـ / 1891.[13] لاحقاً جرت محاولات لتأسيس دولة سعودية ثالثة فتم ذلك على يد عبد العزيز آل سعود سنة 1319 هـ / 1902، فأصبحت لاحقاً سلطنة نجد ثم بعد ذلك مملكة الحجاز ونجد وملحقاتها إلى أن أصبحت تحت مسمى المملكة العربية السعودية بعد توحيد جميع أراضيها في كيان واحد، وكان ذلك في 1351 هـ / 23 سبتمبر 1932م.[14] تتألف السعودية حالياً من 13 منطقةً إداريّةً، تنقسم كلّ منطقةٍ منها إلى عددٍ من المحافظات يختلف عددها من منطقةٍ إلى أخرى، وتنقسم المحافظة إلى مراكز ترتبط إدارياً بالمحافظة أو الإمارة.[7] يوجد بها المسجد الحرام الواقع في مكة المكرمة، والمسجد النبوي في المدينة المنورة، واللذان يعدان أهم الأماكن المقدسة عند المسلمين.</p><p style=\"text-align: right;\">السعودية عضو في مجلس التعاون لدول الخليج العربية وجامعة الدول العربية والأمم المتحدة وحركة عدم الانحياز ورابطة العالم الإسلامي ومنظمة التعاون الإسلامي ومجموعة العشرين وصندوق النقد الدولي ومنظمة التجارة العالمية ومنظمة الدول المصدرة للنفط (أوبك).[15]</p><p style=\"text-align: right;\">تتمتع السعودية بوضع سياسي واقتصادي مستقر في العموم واقتصادها نفطي إذ أنها تمتلك ثاني أكبر إحتياطي للبترول وسادس احتياطي غاز،[16] وأكبر مصدر نفط خام في العالم والذي يشكل قرابة 90% من الصادرات، وتحتل المملكة المرتبة التاسعة عشر من بين أكبر اقتصادات العالم وهي خامس أكبر مساهم في صندوق النقد الدولي والبنك الدولي، وتملك حق نقض فيتو بقوة 3% في صندوق النقد الدولي.[17] وتُعتبر السعودية من القوى المؤثرة سياسياً واقتصادياً في العالم، لمكانتها الإسلامية وثروتها الاقتصادية وتحكمها بأسعار النفط وإمداداته العالمية ووجودها الإعلامي الكبير المتمثل في عدد من القنوات الفضائية والصحف المطبوعة.</p>','<p style=\"text-align: left;\">Yehia Massoud is the Head of the Electrical and Computer Engineering  (ECE) department at Worcester Polytechnic Institute (WPI).</p>','<p>Early Islamic governments<br />Main article: Caliphate</p>','<p>Salman was first appointed as the Deputy governor of Riyadh Province in 1954 as a 19 year old and held the post till 1955.</p>',0,'',1,0),(17,'المشروع الأول','First Project',18,'24','83','','0','0000-00-00','','','','','',1,'2015-02-28',6,2015,0,'0000-00-00 00:00:00',0.00,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,'0000-00-00','2',3,'','','','','','','','','<p style=\"text-align: right;\">&nbsp;أخي الطالب / أختي الطالبة :<br />قبل أن تبدأ في دراسة هذا البرنامج يجب أن تتعرف أولا على الأهداف العامة له وهى كالتالي:<br />يهدف البرنامج إلى تنمية مهارات برنامج اعداد المشاريع البحثية والتي سوف تؤدى بدورها إلى:<br />- تنمية المهارات الأساسية التي تمكنهم من اعداد المشروع البحث بما يتفق مع متطلبات المقرر.<br />- تنمية مهارات اختيار موضوع المشروع.<br />- تنمية مهارات اعداد خطة المشروع.<br />- تنمية مهارات تنفيذ المشروع.<br />- تنمية مهارات عرض ومناقشة المشروع.</p><p>&nbsp;</p>','<p style=\"text-align: right;\">&nbsp;أخي الطالب / أختي الطالبة :<br />قبل أن تبدأ في دراسة هذا البرنامج يجب أن تتعرف أولا على الأهداف العامة له وهى كالتالي:<br />يهدف البرنامج إلى تنمية مهارات برنامج اعداد المشاريع البحثية والتي سوف تؤدى بدورها إلى:<br />- تنمية المهارات الأساسية التي تمكنهم من اعداد المشروع البحث بما يتفق مع متطلبات المقرر.<br />- تنمية مهارات اختيار موضوع المشروع.<br />- تنمية مهارات اعداد خطة المشروع.<br />- تنمية مهارات تنفيذ المشروع.<br />- تنمية مهارات عرض ومناقشة المشروع.</p>','<p>&nbsp;This paper presents the current state of the art on attack and defense modeling approaches<br />that are based on directed acyclic graphs (DAGs). DAGs allow for a hierarchical decomposition<br />of complex scenarios into simple, easily understandable and quantifiable actions. Methods<br />based on threat trees and Bayesian networks are two well-known approaches to security<br />modeling. However there exist more than 30 DAG-based methodologies, each having<br />different features and goals.<br />The objective of this survey is to summarize the existing methodologies, compare their<br />features, and propose a taxonomy of the described formalisms. This article also supports<br />the selection of an adequate modeling technique depending on user requirements.</p>','<p>&nbsp;&nbsp;Graphical security models provide a useful method to represent<br />and analyze security scenarios that examine vulnerabilities<br />of systems and organizations. The great advantage<br />of graph-based approaches lies in combining user friendly,<br />intuitive, visual features with formal semantics and algorithms<br />that allow for qualitative and quantitative analyses.<br />Over the course of the last two decades, graphical modeling<br />has attracted the attention of numerous security and formal<br />methods experts. It has quickly become a stand-alone research<br />area with dedicated dissemination events [1] as well<br />as related national and international research projects [2&ndash;9].<br />Graphical models constitute a valuable support tool to facilitate<br />threat assessment and risk management of real-life systems.</p>','<p>&nbsp;Graphical security models provide a useful method to represent<br />and analyze security scenarios that examine vulnerabilities<br />of systems and organizations. The great advantage<br />of graph-based approaches lies in combining user friendly,<br />intuitive, visual features with formal semantics and algorithms<br />that allow for qualitative and quantitative analyses.<br />Over the course of the last two decades, graphical modeling<br />has attracted the attention of numerous security and formal<br />methods experts. It has quickly become a stand-alone research<br />area with dedicated dissemination events [1] as well<br />as related national and international research projects [2&ndash;9].<br />Graphical models constitute a valuable support tool to facilitate<br />threat assessment and risk management of real-life systems.</p>',0,'',1,0),(18,'تطوير حزمة برمجية للمساعدة في البرمجة الالية','Development of a software package for automatic translation',18,'22','76','','0','0000-00-00','','','','','',1,'2015-03-01',6,2015,0,'0000-00-00 00:00:00',0.00,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,'0000-00-00','2',3,'','','','','','','','','<p style=\"text-align: justify;\"><u><strong>Programming language:</strong></u></p><p style=\"text-align: justify;\">&nbsp;A programming language is a <g class=\"gr_ gr_14 gr-alert gr_gramm Grammar multiReplace\" id=\"14\" data-gr-id=\"14\">formal</g> constructed language designed to communicate instructions to a machine, particularly a computer. Programming languages can be used to create programs to control the behavior of a machine or to express algorithms.</p><p>The earliest programming languages preceded the invention of the digital computer and were used to direct the behavior of machines such as Jacquard looms and player pianos.[1] Thousands of different programming languages have been created, mainly in the computer field, and many more still are being created every year. Many programming languages require computation to be specified in an imperative form (i.e., as a sequence of operations to perform), while other languages utilize other forms of program specification such as the declarative form (i.e. the desired result is specified, not how to achieve it).</p><p style=\"text-align: justify;\">The description of a programming language is usually split into the two components of syntax (form) and semantics (meaning). Some languages are defined by a specification document (for example, the C programming language is specified by an ISO Standard), while other languages (such as Perl) have a dominant implementation that is treated as a reference.</p><p style=\"text-align: justify;\">(code)</p>','<p>&nbsp;السعودية ورسمياً المملكة العربية السعودية هي دولة تقع في جنوب غرب آسيا وتشكل الجزء الأكبر من شبه الجزيرة العربية إذ تبلغ مساحتها حوالي مليوني كيلومتر مربع. يحدها من الشمال العراق والأردن وتحدها الكويت من الشمال الشرقي، ومن الشرق تحدها كل من قطر والإمارات العربية المتحدة بالإضافة إلى البحرين التي ترتبط بالسعودية من خلال جسر الملك فهد الواقع على الخليج العربي، ومن الجنوب تحدها اليمن، وسلطنة عمان من الجنوب الشرقي، كما يحدها البحر الأحمر من جهة الغرب.[11]<br />كانت بداية السعودية بتأسيس الدولة السعودية الأولى (إمارة الدرعية) على يد محمد بن سعود سنة 1157 هـ / 1744 والتي انتهت سنة 1235 هـ / 1820،[12] ثم تبعتها الدولة السعودية الثانية (إمارة نجد) وكانت قد بدأت بعد سقوط الدولة الأولى إلى أن انتهت سنة 1308 هـ / 1891.[13] لاحقاً جرت محاولات لتأسيس دولة سعودية ثالثة فتم ذلك على يد عبد العزيز آل سعود سنة 1319 هـ / 1902، فأصبحت لاحقاً سلطنة نجد ثم بعد ذلك مملكة الحجاز ونجد وملحقاتها إلى أن أصبحت تحت مسمى المملكة العربية السعودية بعد توحيد جميع أراضيها في كيان واحد، وكان ذلك في 1351 هـ / 23 سبتمبر 1932م.[14] تتألف السعودية حالياً من 13 منطقةً إداريّةً، تنقسم كلّ منطقةٍ منها إلى عددٍ من المحافظات يختلف عددها من منطقةٍ إلى أخرى، وتنقسم المحافظة إلى مراكز ترتبط إدارياً بالمحافظة أو الإمارة.[7] يوجد بها المسجد الحرام الواقع في مكة المكرمة، والمسجد النبوي في المدينة المنورة، واللذان يعدان أهم الأماكن المقدسة عند المسلمين.<br />السعودية عضو في مجلس التعاون لدول الخليج العربية وجامعة الدول العربية والأمم المتحدة وحركة عدم الانحياز ورابطة العالم الإسلامي ومنظمة التعاون الإسلامي ومجموعة العشرين وصندوق النقد الدولي ومنظمة التجارة العالمية ومنظمة الدول المصدرة للنفط (أوبك).[15]<br />تتمتع السعودية بوضع سياسي واقتصادي مستقر في العموم واقتصادها نفطي إذ أنها تمتلك ثاني أكبر إحتياطي للبترول وسادس احتياطي غاز،[16] وأكبر مصدر نفط خام في العالم والذي يشكل قرابة 90% من الصادرات، وتحتل المملكة المرتبة التاسعة عشر من بين أكبر اقتصادات العالم وهي خامس أكبر مساهم في صندوق النقد الدولي والبنك الدولي، وتملك حق نقض فيتو بقوة 3% في صندوق النقد الدولي.[17] وتُعتبر السعودية من القوى المؤثرة سياسياً واقتصادياً في العالم، لمكانتها الإسلامية وثروتها الاقتصادية وتحكمها بأسعار النفط وإمداداته العالمية ووجودها الإعلامي الكبير المتمثل في عدد من القنوات الفضائية والصحف المطبوعة.</p>','<p>&nbsp;afewf</p>','<p>&nbsp;In pre-Islamic times, apart from a small number of urban trading settlements (such as Mecca and Medina), most of what was to become Saudi Arabia was populated by nomadic tribal societies in the inhospitable desert.[34] The Islamic prophet, Muhammad, was born in Mecca in about 571 A.D. In the early 7th century, Muhammad united the various tribes of the peninsula and created a single Islamic religious polity. Following his death in 632, his followers rapidly expanded the territory under Muslim rule beyond Arabia, conquering huge swathes of territory (from the Iberian Peninsula in west to modern day Pakistan in east) in a matter of decades. In so doing, Arabia soon became a politically peripheral region of the Muslim world as the focus shifted to the more developed conquered lands.[35] From the 10th century to the early 20th century Mecca and Medina were under the control of a local Arab ruler known as the Sharif of Mecca, but at most times the Sharif owed allegiance to the ruler of one of the major Islamic empires based in Baghdad, Cairo or Istanbul. Most of the remainder of what became Saudi Arabia reverted to traditional tribal rule.[36][37]</p>','<p>&nbsp;Saudi Arabia</p>',2,'test',1,0),(19,'fyjftg','fhjfgh',12,'2','6','','0','0000-00-00','','','','','',1,'2015-03-01',1,2015,0,'0000-00-00 00:00:00',0.00,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,'0000-00-00','1',3,'','','','','','','','','<p>kujkjkjky</p>','<p>kutyu</p>','<p>uttuku</p>','<p>utygukukyt</p>','<p>jktujkum</p>',0,'',1,0),(20,'الحاسبات الفائقة السرعة','ٍSupercomputer',18,'22','77','','0','0000-00-00','','uploads/20/c9a00b39e6c1a25c79966ae6346e9e0da535c71b.pdf','uploads/20/52cd4cb05f489342d8047bcaa72dfd58a5ad1386.pdf','uploads/20/2473e96bc614a911821242119918a241a41836d6.pdf','uploads/20/fb91fe3fc510f56e59b41a04a39fb691f06e1f2c.pdf',1,'2015-03-02',6,2015,0,'0000-00-00 00:00:00',0.00,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',0,'0000-00-00','1',3,'uploads/20/c254d92ae8263fb151abcf4ad120a9a97bb173d3.pdf','','','','uploads/20/a275e25833a2e2130f1eaa351bf61102d47f888b.pdf','','','uploads/20/f4c9a69f715c3c60aa2fc15795b3834d2dc51b9d.pdf','<p>&nbsp;سثفثقلثيقفلفقلقليبل</p>','<p>&nbsp;بسيشبيشسبشسيبسيبشسيبشسيبسيب</p>','<p>&nbsp;sasfsdfasdgfasdf</p>','<p>&nbsp;hnjdgjhdtyjtydj</p>','<p>&nbsp;dsfzgdfgasdfg</p>',0,'',1,0),(21,'اختبار النظام رقم 150','system testing number 150',12,'1','1','','0','0000-00-00','','uploads/21/160ca02b8bfbca10e20a33a9a18fbf777fd467a8.pdf','uploads/21/b71ae4acc972e397c78344dfd680860ae2360453.pdf','uploads/21/2473e96bc614a911821242119918a241a41836d6.pdf','uploads/21/2011cb18814eeb2b9e40648075590a4bf2199c7b.pdf',1,'2015-03-03',1,2015,0,'0000-00-00 00:00:00',0.00,0,'0000-00-00 00:00:00','0000-00-00 00:00:00',1,'2015-03-03','2',3,'uploads/21/14cafd28a8ee5ab157d6f7b129ab16db7e5caaf8.pdf','','','','uploads/21/6561427d1c6b1e03d76b7e9